function getBlueTheme(){
    var theme_blue = {
        "left" : "data:image/png;base64,",
        "right" : "data:image/png;base64,",
        "lupa" : "data:image/png;base64,"
    };

    return theme_blue;
}


$( document ).ready(function() {
    var theme_blue = getBlueTheme();

    $('.fast_search_prev').css('background','url(' + theme_blue['left'] + ')');
    $('.fast_search_next').css('background','url(' + theme_blue['right'] + ')');
    $('.fast_search_result').css('background','#629FDC').css('border-radius','36px').css('max-width','333px').css('width','333px');
    $('#searchbox_id').css('background','url(' + theme_blue['lupa'] + ')no-repeat #fff').css('border','none')
        .css('border-radius','18').css('background-position-y','2px').css('background-position-x','98%');
    //$('.fast_search_result input[type="text"]')

// minimization of search form
    chrome.storage.sync.get('fast_search_minimal_style', function(a) {
        var x = a['fast_search_minimal_style'];
        if(x){
            minimize_search_form();
        }
        else
        {
            maximize_search_form();
        }
    });

    //minimize_search_form();
});

function maximize_search_form()
{
    $('.fast_search_result').removeClass('mini');
}


function minimize_search_form()
{
    $('.fast_search_result').addClass('mini');
}